// file: /components/LinkButton.jsx
import React from 'react'

const LinkButton = (props) => {
    const { creatorName, ...otherProps } = props;
    return (
    <LinkButton
        {...otherProps}
        to={{
        pathname: '/recipes',
        search: `?creator_name=${creatorName}`,
        }}
    >
        Recipes!
    </LinkButton>
    );
};

export default LinkButton;
